package ar.edu.itba.geb.compiler.java.syntaxtree;import ar.edu.itba.geb.compiler.java.visitors.TypeVisitor;import ar.edu.itba.geb.compiler.java.visitors.Visitor;public class IntegerType implements Type {  private static IntegerType instance = new IntegerType();  public static IntegerType instance() {    return instance;  }  private IntegerType() { }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }  @Override  public String toString() {    return "int";  }}